double var_main(const double& k, const double& d, const double& d0)
{
    return std::exp(-k*(d - d0));
}

//----------------------------------------------------------------------------//

double var_intra(const double& k, const double& d, const double& d0)
{
    return std::exp(-k*(d - d0));
}

