    m_kOH_intra = 1.0;
    m_kHH_intra = 1.0;

    m_kOO = 2.0;
    m_kOH = 2.0;
    m_kHH = 2.0;

    m_kXO = 2.0;
    m_kXH = 2.0;

    m_dOH_intra = 2.0;
    m_dHH_intra = 2.0;

    m_dOO = 2.0;
    m_dOH = 2.0;
