{
    *xxx++ = m_kOH_intra;
    *xxx++ = m_kHH_intra;

    *xxx++ = m_kOO;
    *xxx++ = m_kOH;
    *xxx++ = m_kHH;

    *xxx++ = m_kXO;
    *xxx++ = m_kXH;

    *xxx++ = m_dOH_intra;
    *xxx++ = m_dHH_intra;

    *xxx++ = m_dOO;
    *xxx++ = m_dOH;
    *xxx++ = m_dHH;

    *xxx++ = m_dXO;
    *xxx   = m_dXH; 
}

