bool x3b_h2o_ion_v1::nonlinear_parameters_out_of_range() const //same as MBpol
{
    const double k_min = 0.0;

//    return 0;
    return m_kOO < k_min || m_kOH < k_min || m_kHH < k_min
        || m_dOH_intra < -3.0 || m_dHH_intra < -3.0
        || m_dOO < 0.0 || m_dHH < 0.0 || m_dOH < 0.0;
}

